import React, { useState, useEffect } from "react";
import axios from "axios";

function DataFetch() {
    const [posts, setPosts] = useState([])
    useEffect(() => {
        axios.get("https://dummyjson.com/todos")
            .then(res => {
                console.log(res)
                posts = res.data.todos;
            })
            .catch(error => {
                console.log(error)
                alert(error);
            })
    }, [])
    return (posts)
}

export default DataFetch
